import "./App.css";
import DateTime from "./DateTime";

function App() {
  return (
    /* The screen starts here */
    <div className="Screen">
      <img
        className="image-container"
        src="https://img.rawpixel.com/s3fs-private/rawpixel_images/website_content/rm428-0019-x.jpg?w=800&dpr=1&fit=default&crop=default&q=65&vib=3&con=3&usm=15&bg=F4F4F3&ixlib=js-2.2.1&s=16c4ed18afc4ccfb86f468a829d23a1d"
      />
      <div
        style={{
          width: 320,
          height: 53,
          left: 21,
          top: 103,
          position: "absolute",
        }}
      >
        <div
          style={{
            width: 235,
            height: 44,
            left: 0,
            top: 0,
            position: "absolute",
            background: "white",
            borderRadius: 20,
          }}
        />
        <div
          style={{
            width: 306,
            height: 49,
            left: 14,
            top: 4,
            position: "absolute",
            color: "black",
            fontSize: 30,
            fontFamily: "Lusitana",
            fontWeight: "400",
            wordWrap: "break-word",
          }}
        >
          Hello Anusha!
        </div>
      </div>
    </div>
    /* The screen ends here */
  );
}

export default App;
